import React, { useState } from 'react';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const COLUMNS = {
  orderId: 'Order ID',
  purchaseTimestamp: 'Purchase Timestamp',
  reviewScore: 'Review Score',
  deliveredOnTime: 'Delivered On Time',
  paymentType: 'Payment Type',
  paymentValue: 'Payment Value',
  shippingCost: 'Shipping Cost',
  productCategory: 'Product Category',
  customerState: 'Customer State',
  customerId: 'Customer ID',
  orderStatus: 'Order Status',
  deliveryDurationDays: 'Time to Deliver to Customer Days'
};

const DiagnosticTool = () => {
  const [tests, setTests] = useState([]);
  const [isRunning, setIsRunning] = useState(false);
  const [expandedTest, setExpandedTest] = useState(null);

  const addTest = (name, status, details = {}) => {
    setTests(prev => [...prev, { id: Date.now() + Math.random(), name, status, details, timestamp: new Date().toLocaleTimeString() }]);
  };

  const clearTests = () => setTests([]);

  const runDiagnostics = async () => {
    clearTests();
    setIsRunning(true);

    try {
      // TEST 1: Network Connection
      addTest('Network - Checking API endpoint', 'RUNNING', {});
      try {
        const networkTest = await fetch(`${API_BASE_URL}/data`, { method: 'HEAD' });
        addTest('Network - API Endpoint Reachable', networkTest.ok ? 'PASS' : 'FAIL', {
          status: networkTest.status,
          statusText: networkTest.statusText,
          url: `${API_BASE_URL}/data`
        });
      } catch (err) {
        addTest('Network - API Endpoint Reachable', 'FAIL', {
          error: err.message,
          errorType: err.constructor.name,
          url: `${API_BASE_URL}/data`,
          suggestion: 'Backend server may be down or URL is incorrect'
        });
        setIsRunning(false);
        return;
      }

      // TEST 2: Raw API Response
      addTest('API - Fetching Raw Data', 'RUNNING', {});
      let rawResponse, rawData;
      try {
        rawResponse = await fetch(`${API_BASE_URL}/data`);
        addTest('API - HTTP Response Status', rawResponse.ok ? 'PASS' : 'FAIL', {
          status: rawResponse.status,
          statusText: rawResponse.statusText,
          contentType: rawResponse.headers.get('content-type')
        });

        if (!rawResponse.ok) {
          addTest('API - Response Body (Error)', 'FAIL', {
            status: rawResponse.status,
            suggestion: 'Check backend server logs for errors'
          });
          setIsRunning(false);
          return;
        }

        rawData = await rawResponse.json();
        addTest('API - Response JSON Valid', 'PASS', {
          responseType: typeof rawData,
          isArray: Array.isArray(rawData),
          messageIfObject: rawData.message || rawData.error || 'N/A'
        });
      } catch (err) {
        addTest('API - Response JSON Parsing', 'FAIL', {
          error: err.message,
          suggestion: 'API returned invalid JSON or malformed response'
        });
        setIsRunning(false);
        return;
      }

      // TEST 3: Data Structure
      addTest('Data - Is Array', Array.isArray(rawData) ? 'PASS' : 'FAIL', {
        actualType: typeof rawData,
        isArray: Array.isArray(rawData),
        suggestion: Array.isArray(rawData) ? 'Good' : 'API should return an array of records'
      });

      if (!Array.isArray(rawData)) {
        addTest('Data - Record Count', 'FAIL', { suggestion: 'Cannot check record count - data is not an array' });
        setIsRunning(false);
        return;
      }

      addTest('Data - Record Count', rawData.length > 0 ? 'PASS' : 'FAIL', {
        recordCount: rawData.length,
        suggestion: rawData.length > 0 ? `${rawData.length} records loaded` : 'No records returned from API'
      });

      // TEST 4: First Record Structure
      addTest('Data - First Record Exists', rawData.length > 0 ? 'PASS' : 'FAIL', {
        hasRecords: rawData.length > 0
      });

      if (rawData.length > 0) {
        const firstRecord = rawData[0];
        const recordKeys = Object.keys(firstRecord);
        addTest('Data - First Record Keys', 'PASS', {
          keysFound: recordKeys,
          recordCount: recordKeys.length
        });

        // TEST 5: Check for required columns
        addTest('Data - Required Column Check', 'RUNNING', {});
        const requiredColumns = [COLUMNS.paymentValue, COLUMNS.reviewScore, COLUMNS.customerState, COLUMNS.orderStatus];
        const missingColumns = requiredColumns.filter(col => !recordKeys.includes(col));

        if (missingColumns.length === 0) {
          addTest('Data - Required Columns Present', 'PASS', {
            foundColumns: requiredColumns.map(col => `"${col}"`)
          });
        } else {
          addTest('Data - Required Columns Present', 'FAIL', {
            missingColumns: missingColumns.map(col => `"${col}"`),
            availableColumns: recordKeys.map(col => `"${col}"`),
            suggestion: 'Column names in data do not match expected column names'
          });
        }

        // TEST 6: Data Type Validation
        addTest('Data - Type Validation for Payment Value', 'RUNNING', {});
        const samplePaymentValues = rawData.slice(0, 5).map((d, idx) => ({
          index: idx,
          raw: d[COLUMNS.paymentValue],
          type: typeof d[COLUMNS.paymentValue],
          parsed: parseFloat(d[COLUMNS.paymentValue]),
          isValid: !isNaN(parseFloat(d[COLUMNS.paymentValue]))
        }));

        const validPayments = samplePaymentValues.filter(p => p.isValid).length;
        addTest('Data - Payment Values Parseable', validPayments > 0 ? 'PASS' : 'FAIL', {
          samplesChecked: 5,
          validSamples: validPayments,
          samples: samplePaymentValues,
          suggestion: validPayments > 0 ? 'Payment values can be parsed as numbers' : 'Payment values cannot be parsed as numbers'
        });

        // TEST 7: Calculate totals
        addTest('Calculation - Sum Revenue (First 100)', 'RUNNING', {});
        const first100 = rawData.slice(0, 100);
        let totalRev = 0, validCount = 0, invalidCount = 0;

        first100.forEach(d => {
          const val = parseFloat(d[COLUMNS.paymentValue]);
          if (isNaN(val)) {
            invalidCount++;
          } else {
            totalRev += val;
            validCount++;
          }
        });

        addTest('Calculation - Sum Revenue (First 100)', 'PASS', {
          recordsProcessed: first100.length,
          validRecords: validCount,
          invalidRecords: invalidCount,
          totalRevenue: totalRev,
          formattedRevenue: `$${totalRev.toLocaleString('en-US', { maximumFractionDigits: 2 })}`
        });

        // TEST 8: Full data aggregation
        addTest('Calculation - Sum Revenue (ALL)', 'RUNNING', {});
        let fullTotalRev = 0, fullValidCount = 0, fullInvalidCount = 0, nullCount = 0;

        rawData.forEach(d => {
          const val = d[COLUMNS.paymentValue];
          if (val === null || val === undefined) {
            nullCount++;
          } else {
            const parsed = parseFloat(val);
            if (isNaN(parsed)) {
              fullInvalidCount++;
            } else {
              fullTotalRev += parsed;
              fullValidCount++;
            }
          }
        });

        addTest('Calculation - Sum Revenue (ALL)', 'PASS', {
          totalRecords: rawData.length,
          validRecords: fullValidCount,
          invalidRecords: fullInvalidCount,
          nullRecords: nullCount,
          totalRevenue: fullTotalRev,
          formattedRevenue: `$${fullTotalRev.toLocaleString('en-US', { maximumFractionDigits: 2 })}`,
          averagePerRecord: `$${(fullTotalRev / rawData.length).toFixed(2)}`
        });

        // TEST 9: Order Count
        addTest('Calculation - Total Order Count', 'PASS', {
          totalOrders: rawData.length
        });

        // TEST 10: Review Score Stats
        addTest('Calculation - Review Score Analysis', 'RUNNING', {});
        let validReviews = 0, reviewSum = 0, reviewMin = 5, reviewMax = 0;

        rawData.forEach(d => {
          const score = parseFloat(d[COLUMNS.reviewScore]);
          if (!isNaN(score)) {
            validReviews++;
            reviewSum += score;
            reviewMin = Math.min(reviewMin, score);
            reviewMax = Math.max(reviewMax, score);
          }
        });

        addTest('Calculation - Review Score Analysis', 'PASS', {
          recordsWithReview: validReviews,
          totalRecords: rawData.length,
          averageReview: (reviewSum / validReviews).toFixed(2),
          minReview: reviewMin,
          maxReview: reviewMax
        });

        // TEST 11: State distribution
        addTest('Data - State Distribution', 'RUNNING', {});
        const stateMap = {};
        rawData.forEach(d => {
          const state = d[COLUMNS.customerState];
          if (state) {
            stateMap[state] = (stateMap[state] || 0) + 1;
          }
        });

        addTest('Data - State Distribution', 'PASS', {
          uniqueStates: Object.keys(stateMap).length,
          states: stateMap,
          topStates: Object.entries(stateMap)
            .sort((a, b) => b[1] - a[1])
            .slice(0, 5)
            .map(([state, count]) => `${state}: ${count}`)
        });
      }

      addTest('DIAGNOSTIC COMPLETE', 'PASS', { message: 'All tests completed successfully' });
    } catch (err) {
      addTest('FATAL ERROR', 'FAIL', { error: err.message, stack: err.stack });
    } finally {
      setIsRunning(false);
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'PASS': return '#10b981';
      case 'FAIL': return '#ef4444';
      case 'RUNNING': return '#f59e0b';
      default: return '#cbd5e1';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
      case 'PASS': return 'âœ“';
      case 'FAIL': return 'âœ—';
      case 'RUNNING': return 'âŸ³';
      default: return 'â—‹';
    }
  };

  return (
    <div style={{ minHeight: '100vh', background: 'linear-gradient(to bottom right, #0f172a, #1e293b)', padding: '2rem', fontFamily: 'system-ui, -apple-system, sans-serif' }}>
      <div style={{ maxWidth: '1000px', margin: '0 auto' }}>
        <div style={{ background: '#1e293b', borderRadius: '12px', padding: '2rem', border: '1px solid #475569', marginBottom: '2rem' }}>
          <h1 style={{ color: '#60a5fa', margin: '0 0 1rem 0', fontSize: '2rem', fontWeight: 'bold' }}>
            ðŸ”§ API Pipeline Diagnostic Tool
          </h1>
          <p style={{ color: '#cbd5e1', margin: '0 0 1.5rem 0' }}>
            Tests data flow from API endpoint through parsing and calculations
          </p>

          <div style={{ display: 'flex', gap: '1rem', marginBottom: '2rem' }}>
            <button
              onClick={runDiagnostics}
              disabled={isRunning}
              style={{
                padding: '0.75rem 1.5rem',
                background: isRunning ? '#64748b' : '#2563eb',
                color: 'white',
                border: 'none',
                borderRadius: '8px',
                cursor: isRunning ? 'not-allowed' : 'pointer',
                fontWeight: 'bold',
                fontSize: '1rem'
              }}
            >
              {isRunning ? 'âŸ³ Running Tests...' : 'â–¶ Run Diagnostics'}
            </button>

            <button
              onClick={clearTests}
              disabled={isRunning || tests.length === 0}
              style={{
                padding: '0.75rem 1.5rem',
                background: tests.length === 0 ? '#64748b' : '#ef4444',
                color: 'white',
                border: 'none',
                borderRadius: '8px',
                cursor: tests.length === 0 ? 'not-allowed' : 'pointer',
                fontWeight: 'bold'
              }}
            >
              Clear Results
            </button>
          </div>

          {tests.length > 0 && (
            <div style={{ marginTop: '1.5rem', padding: '1rem', background: '#0f172a', borderRadius: '8px', border: '1px solid #475569' }}>
              <div style={{ color: '#22d3ee', fontWeight: 'bold', marginBottom: '1rem' }}>
                Results: {tests.length} tests run
              </div>

              {tests.map((test) => (
                <div
                  key={test.id}
                  style={{
                    marginBottom: '0.5rem',
                    border: `2px solid ${getStatusColor(test.status)}`,
                    borderRadius: '6px',
                    overflow: 'hidden'
                  }}
                >
                  <div
                    onClick={() => setExpandedTest(expandedTest === test.id ? null : test.id)}
                    style={{
                      display: 'flex',
                      alignItems: 'center',
                      gap: '1rem',
                      padding: '1rem',
                      background: `${getStatusColor(test.status)}20`,
                      cursor: 'pointer',
                      userSelect: 'none'
                    }}
                  >
                    <span
                      style={{
                        color: getStatusColor(test.status),
                        fontWeight: 'bold',
                        fontSize: '1.2rem',
                        width: '24px',
                        textAlign: 'center'
                      }}
                    >
                      {getStatusIcon(test.status)}
                    </span>
                    <span style={{ color: '#e2e8f0', fontWeight: '600', flex: 1 }}>
                      {test.name}
                    </span>
                    <span style={{ color: '#94a3b8', fontSize: '0.85rem' }}>
                      {test.timestamp}
                    </span>
                    <span style={{ color: getStatusColor(test.status), fontWeight: 'bold' }}>
                      {expandedTest === test.id ? 'â–¼' : 'â–¶'}
                    </span>
                  </div>

                  {expandedTest === test.id && (
                    <div style={{ padding: '1rem', background: '#1e293b', color: '#cbd5e1', fontSize: '0.875rem', borderTop: `1px solid ${getStatusColor(test.status)}` }}>
                      <pre
                        style={{
                          margin: 0,
                          whiteSpace: 'pre-wrap',
                          wordBreak: 'break-word',
                          fontFamily: 'monospace',
                          background: '#0f172a',
                          padding: '0.75rem',
                          borderRadius: '4px',
                          overflow: 'auto',
                          maxHeight: '400px'
                        }}
                      >
                        {JSON.stringify(test.details, null, 2)}
                      </pre>
                    </div>
                  )}
                </div>
              ))}
            </div>
          )}
        </div>

        <div style={{ background: '#1e293b', borderRadius: '12px', padding: '1.5rem', border: '1px solid #475569', color: '#cbd5e1', fontSize: '0.875rem' }}>
          <h3 style={{ color: '#60a5fa', marginTop: 0 }}>ðŸ“‹ What This Tests:</h3>
          <ul style={{ marginLeft: '1.5rem', lineHeight: '1.8' }}>
            <li><strong>Network:</strong> Can the app reach your backend API?</li>
            <li><strong>API Response:</strong> Does the API return valid JSON?</li>
            <li><strong>Data Structure:</strong> Is the response an array? Does it have records?</li>
            <li><strong>Columns:</strong> Are the expected column names present?</li>
            <li><strong>Data Types:</strong> Can payment values be parsed as numbers?</li>
            <li><strong>Calculations:</strong> What's the actual total revenue? How many valid records?</li>
            <li><strong>Completeness:</strong> What % of records have payment data?</li>
            <li><strong>State Distribution:</strong> Are customer states being tracked correctly?</li>
          </ul>

          <h3 style={{ color: '#60a5fa' }}>ðŸŽ¯ How to Use:</h3>
          <ol style={{ marginLeft: '1.5rem', lineHeight: '1.8' }}>
            <li>Click "Run Diagnostics" to test your entire pipeline</li>
            <li>Look for any <span style={{ color: '#ef4444' }}>âœ— FAIL</span> tests</li>
            <li>Click on failed tests to see details and suggestions</li>
            <li>Share the results to debug what's wrong with your data</li>
          </ol>
        </div>
      </div>
    </div>
  );
};

export default DiagnosticTool;
